  false,\n\t\"url\": null,\n\t\"notes\": \"The Fish and Wildlife Service prescribes
  final late-season frameworks from which States may select season dates, limits,
  and other options for migratory bird hunting seasons. The effect of this final rule
  is to facilitate the States' selection of hunting seasons and to further the annual
  establishment of the late-season migratory bird hunting regulations. This dataset
  contains the following administrative waterfowl flyway delineations that are used
  by states in this process. Atlantic Flyway--includes Connecticut, Delaware, Florida,
  Georgia, Maine, Maryland, Massachusetts, New Hampshire, New Jersey, New York, North
  Carolina, Pennsylvania, Rhode Island, South Carolina, Vermont, Virginia, and West
  Virginia. Mississippi Flyway--includes Alabama, Arkansas, Illinois, Indiana, Iowa,
  Kentucky, Louisiana, Michigan, Minnesota, Mississippi, Missouri, Ohio, Tennessee,
  and Wisconsin. Central Flyway--includes Colorado (east of the Continental Divide),
  Kansas, Montana (Counties of Blaine, Carbon, Fergus, Judith Basin, Stillwater, Sweetgrass,
  Wheatland, and all counties east thereof), Nebraska, New Mexico (east of the Continental
  Divide except the Jicarilla Apache Indian Reservation), North Dakota, Oklahoma,
  South Dakota, Texas, and Wyoming (east of the Continental Divide). Pacific Flyway--includes
  Alaska, Arizona, California, Idaho, Nevada, Oregon, Utah, Washington, and those
  portions of Colorado, Montana, New Mexico, and Wyoming not included in the Central
  Flyway.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
